import logo from '../images/logo.svg';
import header_img from '../images/header_img.jpg';
import footer from '../images/footerimage.jpg';
import uzh from '../images/uzh.svg';
import './App.css';
import { report } from './data.js';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';

class App extends React.Component {
    render() {
        return <div className="App">
            <header className="App-header" style= { {
                backgroundImage: `url(${header_img})`
            }}>
                <div className="App-logo">
                    <img src={uzh} alt={"uzh_logo"}/>
                </div>
                <div>
                    <h1 className="App-title">LAWrgMiner Project</h1>
                    <hr className="solid"></hr>
                    <h6>Artificial Intelligence: Technology and Law</h6>
                    <Button variant="outline-light" >Use LAWrgMiner</Button>
                </div>
            </header>
            <body>
            <div className="light">
                <h2 className="section">{report[0].section}</h2>
                <h6 className="text">
                    {report[0].text}
                </h6>
            </div>
            <div className="dark">
                <h2 className="section">{report[1].section}</h2>
                <h6 className="text">
                    {report[1].text}
                </h6>
            </div>
            </body>
            <footer className="App-footer" style= { {
                backgroundImage: `url(${footer})`
            }}>
                <div>
                    <h3>AI</h3>
                </div>

            </footer>
        </div>
    }
}

export default App;
